var title_f15_60_16327="Capillaria philippinensis life cycle";
var content_f15_60_16327=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F65145&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F65145&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 477px\">",
"   <div class=\"ttl\">",
"    Capillaria philippinensis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 457px; height: 597px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Typically, unembryonated eggs are passed in the human stool",
"    <strong>",
"     (1)",
"    </strong>",
"    and become embryonated in the external environment",
"    <strong>",
"     (2)",
"    </strong>",
"    ; after ingestion by freshwater fish, larvae hatch, penetrate the intestine, and migrate to the tissues",
"    <strong>",
"     (3)",
"    </strong>",
"    . Ingestion of raw or undercooked fish results in infection of the human host",
"    <strong>",
"     (4)",
"    </strong>",
"    . The adults of",
"    <em>",
"     Capillaria philippinensis",
"    </em>",
"    (males: 2.3 to 3.2 mm; females: 2.5 to 4.3 mm) reside in the human small intestine, where they burrow in the mucosa",
"    <strong>",
"     (5)",
"    </strong>",
"    . The females deposit unembryonated eggs. Some of these become embryonated in the intestine, and release larvae that can cause autoinfection. This leads to hyperinfection (a massive number of adult worms)",
"    <strong>",
"     (6)",
"    </strong>",
"    .",
"    <em>",
"     Capillaria philippinesis",
"    </em>",
"    is currently considered a parasite of fish eating birds, which seem to be the natural definitive host",
"    <strong>",
"     (7)",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Capillariasis. Available at:",
"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/capillariasis.htm\" target=\"_blank\">",
"      file://www.dpd.cdc.gov/dpdx/html/capillariasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
