" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Geriatric bipolar disorder: Acute treatment",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?15/60/16330/contributors\">",
