var title_f15_60_16332="Acetaminophen toxicity";
var content_f15_60_16332=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F57032&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F57032&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Stages of acute acetaminophen intoxication",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Stage",
"       </td>",
"       <td class=\"subtitle1\">",
"        Hours after ingestion",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"3\">",
"        I",
"       </td>",
"       <td rowspan=\"3\">",
"        0.5 to 24 hours",
"       </td>",
"       <td>",
"        Nausea, vomiting, diaphoresis, pallor, lethargy, and malaise",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Some patients remain asymptomatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Laboratory studies are typically normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"7\">",
"        II&nbsp;&nbsp;",
"       </td>",
"       <td rowspan=\"7\">",
"        24 to 72 hours",
"       </td>",
"       <td>",
"        Stage I symptoms resolve",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatotoxicity and nephrotoxicity become evident",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Right upper quadrant pain, liver enlargement and tenderness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevation of aminotransferases occurs within 36 hours of ingestion in patients with hepatic injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevation of prothrombin time (PT) and internationalized ratio of PT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oliguria, abnormalities of renal function",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevation of serum amylase with or without clinical pancreatitis may occur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"5\">",
"        III",
"       </td>",
"       <td rowspan=\"5\">",
"        72 to 96 hours",
"       </td>",
"       <td>",
"        Liver enzyme and function abnormalities peak (enzymes may be &gt;10,000 IU/L)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recurrence of Stage I symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Jaundice, hepatic encephalopathy, hyperammonemia, bleeding diathesis, hypoglycemia, lactic acidosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal failure, the incidence of which is related to the severity of intoxication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Death, from multi-organ failure, occurs most commonly in this stage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"3\">",
"        IV",
"       </td>",
"       <td rowspan=\"3\">",
"        4 to 14 days",
"       </td>",
"       <td>",
"        Recovery phase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Symptoms and laboratory values may not normalize for several weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Histologic recovery lags behind clinical recovery and may take up to three months",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
