" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    TNM staging for anal cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Primary tumor (T)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        TX",
"       </td>",
"       <td colspan=\"3\">",
"        Primary tumor cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T0",
"       </td>",
"       <td colspan=\"3\">",
"        No evidence of primary tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tis",
"       </td>",
"       <td colspan=\"3\">",
"        Carcinoma in situ (Bowen's disease, high-grade squamous intraepithelial lesion (HSIL), anal intraepithelial neoplasia II-III (AIN II-III))",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T1",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor 2 cm or less in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor more than 2 cm but not more than 5 cm in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor more than 5 cm in greatest dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T4",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor of any size invades adjacent organ(s), eg, vagina, urethra, bladder*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Regional lymph nodes (N)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        NX",
"       </td>",
"       <td colspan=\"3\">",
"        Regional lymph nodes cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N0",
"       </td>",
"       <td colspan=\"3\">",
"        No regional lymph node metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N1",
"       </td>",
"       <td colspan=\"3\">",
"        Metastasis in perirectal lymph node(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N2",
"       </td>",
"       <td colspan=\"3\">",
"        Metastasis in unilateral internal iliac and/or inguinal lymph node(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N3",
"       </td>",
"       <td colspan=\"3\">",
"        Metastasis in perirectal and inguinal lymph nodes and/or bilateral internal iliac and/or inguinal lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Distant metastasis (M)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M0",
"       </td>",
"       <td colspan=\"3\">",
"        No distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M1",
"       </td>",
"       <td colspan=\"3\">",
"        Distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Anatomic stage/prognostic groups",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        Tis",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        T1",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        II",
"       </td>",
"       <td>",
"        T2",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        IIIA",
"       </td>",
"       <td>",
"        T1",
"       </td>",
"       <td>",
"        N1",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2",
"       </td>",
"       <td>",
"        N1",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3",
"       </td>",
"       <td>",
"        N1",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T4",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        IIIB",
"       </td>",
"       <td>",
"        T4",
"       </td>",
"       <td>",
"        N1",
"       </td>",
"       <td>",
