"   <div class=\"lgnd\">",
"    <strong>",
"     Classifying severity in children who are not currently taking long-term control medication.",
"    </strong>",
"    Level of severity is determined by both impairment and risk. Assess impairment domain by patient's/caregiver's recall of the previous 2-4 weeks and spirometry. Assign severity to the most severe category in which any feature occurs. At present, there are inadequate data to correspond frequencies of exacerbations with different levels of asthma severity. In general, more frequent and intense exacerbations (eg, requiring urgent, unscheduled care, hospitalization, or ICU admission) indicate greater underlying disease severity. For treatment purposes, patients who had &ge;2 exacerbations requiring oral systemic corticosteroids in the past year may be considered the same as patients who have persistent asthma, even in the absence of impairment levels consistent with persistent asthma.",
"    <div class=\"footnotes\">",
